def get_indexer(
    self,
    target: AnyArrayLike,
    method: Optional[str] = None,
    limit: Optional[int] = None,
    tolerance: Optional[Any] = None,
) -> np.ndarray:

    self._check_method(method)

    if self.is_overlapping:
        msg = (
            "cannot handle overlapping indices; use "
            "IntervalIndex.get_indexer_non_unique"
        )
        raise InvalidIndexError(msg)

    target_as_index = ensure_index(target)

    if isinstance(target_as_index, IntervalIndex) or isinstance(target_as_index, CategoricalIndex):
        # Handle IntervalIndex and CategoricalIndex
        indexer = target_as_index.get_indexer(self)
    else:
        if not is_object_dtype(target_as_index):
            # Handle other index types
            indexer = self._engine.get_indexer(target_as_index.values)
        else:
            # Handle heterogeneous scalar index
            indexer = []
            for key in target_as_index:
                try:
                    loc = self.get_loc(key)
                except KeyError:
                    loc = -1
                indexer.append(loc)

    return ensure_platform_int(indexer)
